import React, {Component} from 'react';
import PropTypes from 'prop-types';
import injectSheet from "react-jss";
import { react } from "@nosplatform/api-functions";


const { injectNOS } = react.default;

const styles = {
  container: {
    borderRadius: "5px",
    backgroundColor: "#f2f2f2",
    padding: "20px",
    margin: "20px"

  },
  col25: {
    float: "left",
    width: "30%",
    marginTop: "20px"
  },
  col75: {
    float: "left",
    width: "65%",
    marginTop: "20px"
  },
  row:{
    content: "",
    clear: "both"
  },
  label: {
    padding: ["12px", "12px", "12px", "0px"],
    display: "inline-block",
    fontSize: "15px"
  },
  input: {
    width: "100%",
    padding: "12px",
    border: ["1px", "solid", "#ccc"],
    borderRadius: "4px",
    resize: "vertical"
  },
  submit_btn: {
    width: "100%",
    marginTop: "20px",
    fontSize: "20px",
    padding: "6px",
    border: ["1px", "solid", "#ccc"],
    borderRadius: "6px",
    background: "#3CB371",
    '&:hover': {
      cursor: "pointer",
      background: "#2c8e75"
    }
  }
};


class ApplyForm extends Component {

  state = {
    orgname: "",
    person: "",
    email: "",
    phone: ""
  }

  handleChange = e => {
    this.setState({[e.target.name]: e.target.value})
  }

  render() {
    const {classes} = this.props;
    return(
      <React.Fragment>
        <div className={classes.container}>
          <form>
            <div className={classes.row}>
              <div className={classes.col25}>
                <label className={classes.label}>Organization Name:</label>
              </div>
              <div className={classes.col75}>
                <input className={classes.input}
                  type="text" id="orgname"
                  name="orgname"
                  placeholder="Enter organization's name here..."
                  value={this.state.orgname}
                  onChange={this.handleChange}/>
              </div>
            </div>

            <div className={classes.row}>
              <div className={classes.col25}>
                <label className={classes.label}>Contact Person:</label>
              </div>
              <div className={classes.col75}>
                <input className={classes.input}
                  type="text" id="person"
                  name="person"
                  placeholder="Enter contact person here..."
                  value={this.state.person}
                  onChange={this.handleChange}/>
              </div>
            </div>

            <div className={classes.row}>
              <div className={classes.col25}>
                <label className={classes.label}>Email Address:</label>
              </div>
              <div className={classes.col75}>
                <input className={classes.input}
                  type="email" id="email"
                  name="email"
                  placeholder="Enter email adddress here..."
                  value={this.state.email}
                  onChange={this.handleChange}/>
              </div>
            </div>

            <div className={classes.row}>
              <div className={classes.col25}>
                <label className={classes.label}>Phone Number:</label>
              </div>
              <div className={classes.col75}>
                <input className={classes.input}
                  type="text" id="phone"
                  name="phone"
                  placeholder="Enter phone number here..."
                  value={this.state.phone}
                  onChange={this.handleChange}/>
              </div>
            </div>

            <div className={classes.row}>
              <input className={classes.submit_btn}
                type="submit" value="Submit" />
            </div>
          </form>
        </div>
      </React.Fragment>
    );
  }


}

  ApplyForm.propTypes = {
    classes: PropTypes.objectOf(PropTypes.any).isRequired,
    handleInvoke: PropTypes.func.isRequired
  };

export default injectNOS(injectSheet(styles)(ApplyForm));
